import React from 'react';
import { Counter } from './features/counter/Counter';
import './App.css';
import Header from './components/Header'
import Slider from './components/Slider';
import Section from './components/Section';

function App() {
  return (
    <div className="App">
        <Header />
        <Slider />
        <Section />
    </div>
  );
}

export default App;
